import React, { Component } from 'react';
import {Link as RRNavLink } from "react-router-dom";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
} from 'reactstrap';
import logo from '../imgs/logo.jpg';
import img from '../imgs/ioniconflame.png'
import Breadcrumbs from '../components/Breadcrumbs'
import '../css/navbar.css'

const links = [
  { href: '/', text: 'Home' },
  { href: '/about', text: 'About Us' },
  { href: '/board', text: 'Our Board' },
  { href: '/calendar', text: 'Calendar' }
];

const createNavItem = ({ href, text, className }) => (
  <NavItem>
    <NavLink tag={RRNavLink} to={href} /*href={href}*/ className={className}>{text}</NavLink>
  </NavItem>
);

export default class Example extends Component {
  constructor(props) {
    super(props);

    this.state = {
      isOpen: false
    };

    this.toggle = this.toggle.bind(this);
  }

  toggle() {
    this.setState({
      isOpen: !this.state.isOpen
    });
  }
  
  render() {
    return (
      <div style={{/*backgroundColor : '#e6e6e6',*/ position :'fixed',/* width: '100%',*/ zIndex: '999'/*, height : 40, top : 55*/}}>
        <div className="logo-img">
          <a href="/">
            <img className="logo" src={logo} alt="" />
          </a>
        </div>
        <Navbar color="light" light expand="md">
          <NavbarBrand href="/"><img style={{position : 'absolute', top : '0%'}} src={img} alt="" width="20" height="40" /></NavbarBrand>
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
              {links.map(createNavItem)}
              <NavItem>
                <NavLink tag={RRNavLink} to="#" onClick={(event) => {window.open("https://www.paypal.com/cgi-bin/webscr?cmd=_s-xclick&hosted_button_id=QMC5JV7U8BDNU&source=url");}} >Donate</NavLink>
              </NavItem>
              <NavItem>
                <NavLink tag={RRNavLink} to="#" onClick={(event) => {window.open("https://www.paypal.com/cgi-bin/webscr?cmd=_s-xclick&hosted_button_id=TP2UXFQ8YDP24&source=url");}} ><b>Hurricane Relief Efforts</b></NavLink>
              </NavItem>
            </Nav>
          </Collapse>
        </Navbar>
        {(this.props.breadcrumbs) ? <div style={{paddingBottom : 100}}><Breadcrumbs crumbs={this.props.breadcrumbs}/></div> : null}
      </div>
    );
  }
}
